import{_ as a,C as e,o as l,c as s,H as r,w as t,k as i,a as h,Q as o}from"./chunks/framework.bc643b65.js";const d=JSON.parse('{"title":"微信小程序的发布流程","description":"","frontmatter":{"createTime":"2022/10/09","tag":"westore"},"headers":[],"relativePath":"interview-question/微信小程序的发布流程.md","filePath":"s/前端面试题/小程序/微信小程序的发布流程.md","lastUpdated":1696495218000}'),n={name:"interview-question/微信小程序的发布流程.md"},c=i("h1",{id:"微信小程序的发布流程",tabindex:"-1"},[h("微信小程序的发布流程 "),i("a",{class:"header-anchor",href:"#微信小程序的发布流程","aria-label":'Permalink to "微信小程序的发布流程"'},"​")],-1),p=o('<h2 id="一、背景" tabindex="-1">一、背景 <a class="header-anchor" href="#一、背景" aria-label="Permalink to &quot;一、背景&quot;">​</a></h2><p>在中大型的公司里，人员的分工非常仔细，一般会有不同岗位角色的员工同时参与同一个小程序项目。为此，小程序平台设计了不同的权限管理使得项目管理者可以更加高效管理整个团队的协同工作 <img src="/assets/release1.5b29cf0a.webp" alt="图片"></p><p>以往我们在开发完网页之后，需要把网页的代码和资源放在服务器上，让用户通过互联网来访问 在小程序的平台里，开发者完成开发之后，需要在开发者工具提交小程序的代码包，然后在小程序后台发布小程序 <img src="/assets/release2.5b16072b.webp" alt="图片"></p><h2 id="二、流程" tabindex="-1">二、流程 <a class="header-anchor" href="#二、流程" aria-label="Permalink to &quot;二、流程&quot;">​</a></h2><h3 id="关于发布的流程-主要分成了三个部分" tabindex="-1">关于发布的流程，主要分成了三个部分 <a class="header-anchor" href="#关于发布的流程-主要分成了三个部分" aria-label="Permalink to &quot;关于发布的流程，主要分成了三个部分&quot;">​</a></h3><ul><li>上传代码</li><li>提交审核</li><li>发布版本</li></ul><h3 id="上传代码" tabindex="-1">上传代码 <a class="header-anchor" href="#上传代码" aria-label="Permalink to &quot;上传代码&quot;">​</a></h3><p>在开发者工具中，可以点击代码上传功能： <img src="/assets/release3.c34295f1.webp" alt="图片"></p><p>然后就可以填写版本信息： <img src="/assets/release4.640c2fdb.webp" alt="图片"></p><p>然后点击上传，编译器则会提示上传代码成功</p><h3 id="提交审核" tabindex="-1">提交审核 <a class="header-anchor" href="#提交审核" aria-label="Permalink to &quot;提交审核&quot;">​</a></h3><p>代码上传完毕，就可以登陆微信公众号的官网首页，点击【开发管理】，查看应用详情： <img src="/assets/release5.f804d43f.webp" alt="图片"></p><p>提交审核过程需要填写审核信息，如下图： <img src="/assets/release6.48cdfefe.webp" alt="图片"></p><p>提交审核成功之后如下图： <img src="/assets/release7.64249551.webp" alt="图片"></p><h3 id="发布版本" tabindex="-1">发布版本 <a class="header-anchor" href="#发布版本" aria-label="Permalink to &quot;发布版本&quot;">​</a></h3><p>当审核通过之后，即可提交发布 <img src="/assets/release8.c84dd523.webp" alt="图片"></p><p>发布成功之后则如下： <img src="/assets/release9.d6e15fd1.webp" alt="图片"></p><h2 id="三、扩展" tabindex="-1">三、扩展 <a class="header-anchor" href="#三、扩展" aria-label="Permalink to &quot;三、扩展&quot;">​</a></h2><h3 id="上述是最简单的小程序代码发布的流程-通常的流程如下" tabindex="-1">上述是最简单的小程序代码发布的流程，通常的流程如下 <a class="header-anchor" href="#上述是最简单的小程序代码发布的流程-通常的流程如下" aria-label="Permalink to &quot;上述是最简单的小程序代码发布的流程，通常的流程如下&quot;">​</a></h3><p><img src="/assets/release10.6fe66057.webp" alt="图片"></p><ul><li>代码管理服务器上新建分支</li><li>开发测试新需求</li><li>测试完成后，将本地分支合并到 master 分支</li><li>拉取 master 分支最新代码，执行 build 命令生成小程序可执行文件</li><li>开发者工具点击“上传”</li><li>提审</li><li>发布 但是面对多人协调开发的时候，有可能出现已经上线的代码还没合并到master的情况 因此可以考虑自动化构建部署，就是将从开发到部署的一系列流程变成自动化，衔接连贯，在构建失败时能够告知开发者，构建成功后能够告知测试和实施人员，可参考如下流程图：</li></ul>',21);const b=a(n,[["render",function(a,i,h,o,d,n){const b=e("ArticleMetadata"),m=e("ClientOnly");return l(),s("div",null,[c,r(m,null,{default:t((()=>[r(b)])),_:1}),p])}]]);export{d as __pageData,b as default};
